import axios from "axios";
import React, { useEffect } from "react";

import NewMusic from "./components/NewMusic";

function App() {
  useEffect(() => {
    axios.get("localhost:5000");
  }, []);
  return (
    <div>
      <NewMusic />
    </div>
  );
}

export default App;
